import '../../../styles/CartPage/headerCartPage.css'

const HeaderCartPage = () => {
    return (
        <div className="header">
            <div className="toolbar">
                <div className="logo">
                    <div className="logoText">Yalantis shop</div>
                </div>
            </div>
        </div>
    )
}


export default HeaderCartPage;
